import React from 'react'

// General imports
import Header from '../../components/Header'
import Footer from '../../components/Footer'
import Slider from './components/Slider'
import * as data from './data/cms.json';

const Overview = () => {
    return (
        <>
            <Header/>
            <Slider data={data}/>
            <Footer/>
        </>
    )
}

export default Overview
